import React from "react";

function ImageSearch(props) {
  console.log(props);
  return (
    <div>
      <form onSubmit={props.handleGetRequest}>
        <input type="text" name="searchvalue" placeholder="search for" />
        <button>Search</button>
      </form>
      <img src="" />
    </div>
  );
}

export default ImageSearch;
